import React, { Component } from "react";

class Palantir extends Component {	 
	render() {
		return (
            <div className='subheader'>
                <div className='support'>
                    <p>Palantir is a software company which specialises in big data analytics. Founded in 2004, Palantir saw the need in the market for a different kind of technology, where with good data, the right technology, people and institutions would be able to solve problems and change the world for the better.</p>
                    <p>Their focus is on creating the world’s best user experience for working with big data, empowering people to ask and answer complex questions without the need to master querying languages, statistical modeling, or the command line. Palantir achieved this through creating a platform for the integration, management and securing of data, in conjunction with building applications for full interactions which are human-driven and machine assisted analysed.</p>
                    <p>Palantir’s success was built on diversity, their unconventional and open-mindedness. This is seen through their community and interest groups which include Women in Technology, Veterans at Palantir, Palantir Parent,s and Palan-Queer. </p>
                </div>
                <br></br>
                <a href="https://www.palantir.com/" className="button" >Visit Palantir</a>
            </div>
        );
	}
}

export default Palantir;
